import React from 'react';
import { withRouter } from 'react-router-dom';
import TopNavigation from './SideNavigation';
const AdminLayout = (props) => {
    return (<div>
        <TopNavigation/>
        {props.children}
    </div>  );
}
 
export default withRouter(AdminLayout);
